webstoreListingDescription.message:
Instalați extensia AudD și faceți clic pe pictograma acesteia pentru a identifica melodia redată în fila curentă.
Urmărește videoclipul de mai sus pentru a vedea cum funcționează.

Extensie AudD:
- Recunoaște muzica redată în browser;
- Găsește muzică în baza de date AudD cu peste 75 de milioane de melodii folosind tehnologia sa de recunoaștere a muzicii;
- Afișează versuri pentru melodiile identificate;
- Afișează linkuri pentru a asculta melodiile pe Apple Music, Spotify, Deezer, YouTube Music;
- Afișează momentul exact din melodia recunoscută când este redat sunetul din browser.

API de recunoaștere a muzicii: https://audd.io
Cod sursă: https://github.com/AudDMusic/chrome-extension

Extensie alimentată de API-ul de recunoaștere a muzicii AudD®

Creat și proiectat de echipa AudD.io cu ajutorul lui Eric Stark, Mitchell Kossoris și Ivan Kasatkin.
